        public static void CheckDumpFull(string dump)
        {
            #region CheckFlashRegionComplet
            using (BinaryReader b = new BinaryReader(new FileStream(dump, FileMode.Open)))
            {
                // Checking very first SCE Magic on offset 0x00
                bufferA = new byte[32];
                bufferZ = new byte[4032];

                b.Read(bufferA, 0, 32);

                if (Tool.CompareBytes(bufferA, sceBigMagic) == true)
                {
                    _sceBigMagic = true;
                }



                // Checking static section 1 @ 00000020
                b.BaseStream.Seek(StaticSection1Offset, SeekOrigin.Begin);
                b.Read(bufferA, 0, 32);

                if (Tool.CompareBytes(bufferA, StaticSection1) == true)
                {
                    _StaticSection1 = true;
                }
                else
                {
                    _StaticSection1 = false;

                }

                //Checking static section 2 00000040
                bufferZ = new byte[4032];
                b.BaseStream.Seek(StaticSection2Offset, SeekOrigin.Begin);
                b.Read(bufferZ, 0, 4032);

                if (Tool.CompareBytes(bufferZ, StaticSection2) == true)
                {
                    _StaticSection2 = true;
                }
                else
                {
                    _StaticSection2 = false;

                }

                //Checking static section 3 00001010
                bufferZ = new byte[4080];
                b.BaseStream.Seek(StaticSection3Offset, SeekOrigin.Begin);
                b.Read(bufferZ, 0, 4080);

                if (Tool.CompareBytes(bufferZ, StaticSection3) == true)
                {
                    _StaticSection3 = true;
                }
                else
                {
                    _StaticSection3 = false;

                }

                //Checking static section 4 000020B0
                bufferZ = new byte[3920];
                b.BaseStream.Seek(StaticSection4Offset, SeekOrigin.Begin);
                b.Read(bufferZ, 0, 3920);

                if (Tool.CompareBytes(bufferZ, StaticSection4) == true)
                {
                    _StaticSection4 = true;
                }
                else
                {
                    _StaticSection4 = false;

                }

                //Checking static section 5 000030B0
                bufferZ = new byte[3920];
                b.BaseStream.Seek(StaticSection5Offset, SeekOrigin.Begin);
                b.Read(bufferZ, 0, 3920);

                if (Tool.CompareBytes(bufferZ, StaticSection5) == true)
                {
                    _StaticSection5 = true;
                }
                else
                {
                    _StaticSection5 = false;

                }

                /////////////////
                ///Static in SLB2 00 filled
                //////////////
                ////////////////

                //Checking static section 6 00004070
                bufferZ = new byte[400];
                b.BaseStream.Seek(StaticSection6Offset, SeekOrigin.Begin);
                b.Read(bufferZ, 0, 400);

                if (Tool.CompareBytes(bufferZ, StaticSection6) == true)
                {
                    _StaticSection6 = true;
                }
                else
                {
                    _StaticSection6 = false;

                }

                //Checking static section 7 
                bufferZ = new byte[384];
                b.BaseStream.Seek(StaticSection7Offset, SeekOrigin.Begin);
                b.Read(bufferZ, 0, 384);

                if (Tool.CompareBytes(bufferZ, StaticSection7) == true)
                {
                    _StaticSection7 = true;
                }
                else
                {
                    _StaticSection7 = false;

                }

                //Checking static section 8 
                bufferZ = new byte[352];
                b.BaseStream.Seek(StaticSection8Offset, SeekOrigin.Begin);
                b.Read(bufferZ, 0, 352);

                if (Tool.CompareBytes(bufferZ, StaticSection8) == true)
                {
                    _StaticSection8 = true;
                }
                else
                {
                    _StaticSection8 = false;

                }

                //Checking static section 9 
                bufferZ = new byte[400];
                b.BaseStream.Seek(StaticSection9Offset, SeekOrigin.Begin);
                b.Read(bufferZ, 0, 400);

                if (Tool.CompareBytes(bufferZ, StaticSection9) == true)
                {
                    _StaticSection9 = true;
                }
                else
                {
                    _StaticSection9 = false;

                }

                ///End//////
                ///

                //GET MAIN CONSOLE INFO STRING

                bufferZ = new byte[400];
                b.BaseStream.Seek(StaticSection9Offset, SeekOrigin.Begin);
                b.Read(bufferZ, 0, 400);

                if (Tool.CompareBytes(bufferZ, StaticSection9) == true)
                {
                    _StaticSection9 = true;
                }
                else
                {
                    _StaticSection9 = false;

                }


                // Checking second and third SCE Magic with normal letters
                b.BaseStream.Seek(sceOffset1, SeekOrigin.Begin);
                b.Read(bufferA, 0, 32);

                if (Tool.CompareBytes(bufferA, sceSmallMagic) == true)
                {
                    _sceSmallMagic1 = true;
                }
                else
                {
                    _sceSmallMagic1 = false;

                }

                Array.Clear(bufferA, 0, 32);

                b.BaseStream.Seek(sceOffset2, SeekOrigin.Begin);
                b.Read(bufferA, 0, 32);

                if (Tool.CompareBytes(bufferA, sceSmallMagic) == true)
                {
                    _sceSmallMagic2 = true;
                }
                else
                {
                    _sceSmallMagic2 = false;

                }

                // Checking for 4 SLB2 Headers within the Flash
                bufferA = new byte[5];
                bufferB = new byte[5];
                bufferC = new byte[5];
                bufferD = new byte[5];

                b.BaseStream.Seek(slb2Offset1, SeekOrigin.Begin);
                b.Read(bufferA, 0, 5);
                b.BaseStream.Seek(slb2Offset2, SeekOrigin.Begin);
                b.Read(bufferB, 0, 5);
                b.BaseStream.Seek(slb2Offset3, SeekOrigin.Begin);
                b.Read(bufferC, 0, 5);
                b.BaseStream.Seek(slb2Offset4, SeekOrigin.Begin);
                b.Read(bufferD, 0, 5);

                if (Tool.CompareBytes(bufferA, slb2Magic) == true)
                {

                    _slb2Magic1 = true;
                }
                else
                {
                    _slb2Magic1 = false;
                }
                if (Tool.CompareBytes(bufferB, slb2Magic) == true)
                {
                    _slb2Magic2 = true;
                }
                else
                {
                    _slb2Magic2 = false;
                }
                if (Tool.CompareBytes(bufferC, slb2Magic) == true)
                {
                    _slb2Magic3 = true;
                }
                else
                {
                    _slb2Magic3 = false;
                }
                if (Tool.CompareBytes(bufferD, slb2Magic) == true)
                {
                    _slb2Magic4 = true;
                }
                else
                {
                    _slb2Magic4 = false;
                }

                /*checking C0000001 string in all slb2 container
                 static long C0000001Offset1 = 0x004000;
                static long C0000001Offset2 = 0x004030;
                static long C0010001Offset = 0xC4030;
                static long C0018001Offset = 0xC4090;
                static long eap_kblOffset = 0xC4060;
                static long C0020001Offset = 0x144030;
                static long C0028001Offset = 0x144060;
                 */


                bufferA = new byte[8];
                bufferB = new byte[8];
                bufferC = new byte[8];
                bufferD = new byte[8];
                eap_kbl = new byte[7];
                bufferE = new byte[8];
                bufferF = new byte[8];
                bufferG = new byte[8];
                bufferZ = new byte[8];

                b.BaseStream.Seek(C0000001Offset1, SeekOrigin.Begin);
                b.Read(bufferA, 0, 8);
                b.BaseStream.Seek(C0000001Offset2, SeekOrigin.Begin);
                b.Read(bufferB, 0, 8);
                b.BaseStream.Seek(C0008001Offset1, SeekOrigin.Begin);
                b.Read(bufferC, 0, 8);
                b.BaseStream.Seek(C0008001Offset2, SeekOrigin.Begin);
                b.Read(bufferD, 0, 8);
                b.BaseStream.Seek(C0010001Offset, SeekOrigin.Begin);
                b.Read(bufferF, 0, 8);
                b.BaseStream.Seek(C0018001Offset, SeekOrigin.Begin);
                b.Read(bufferG, 0, 8);
                b.BaseStream.Seek(eap_kblOffset, SeekOrigin.Begin);
                b.Read(eap_kbl, 0, 7);
                b.BaseStream.Seek(C0020001Offset, SeekOrigin.Begin);
                b.Read(bufferE, 0, 8);
                b.BaseStream.Seek(C0028001Offset, SeekOrigin.Begin);
                b.Read(bufferZ, 0, 8);

                if (Tool.CompareBytes(bufferA, C0000001Magic1) == true)
                {
                    _C0000001Magic1 = true;
                }
                else
                {
                    _C0000001Magic1 = false;
                }
                if (Tool.CompareBytes(bufferB, C0000001Magic2) == true)
                {
                    _C0000001Magic2 = true;
                }
                else
                {
                    _C0000001Magic2 = false;
                }
                if (Tool.CompareBytes(bufferC, C0008001Magic1) == true)
                {
                    _C0008001Magic1 = true;
                }
                else
                {
                    _C0008001Magic1 = false;
                }
                if (Tool.CompareBytes(bufferD, C0008001Magic2) == true)
                {
                    _C0008001Magic2 = true;
                }
                else
                {
                    _C0008001Magic2 = false;
                }
                if (Tool.CompareBytes(bufferF, C0010001Magic) == true)
                {
                    _C0010001Magic = true;
                }
                else
                {
                    _C0010001Magic = false;
                }
                if (Tool.CompareBytes(bufferG, C0018001Magic) == true)
                {
                    _C0018001Magic = true;
                }
                else
                {
                    _C0018001Magic = false;
                }
                if (Tool.CompareBytes(eap_kbl, eap_kblMagic) == true)
                {
                    _eap_kblMagic = true;
                }
                else
                {
                    _eap_kblMagic = false;
                }
                if (Tool.CompareBytes(bufferE, C0020001Magic) == true)
                {
                    _C0020001Magic = true;
                }
                else
                {
                    _C0020001Magic = false;
                }
                if (Tool.CompareBytes(bufferZ, C0028001Magic) == true)
                {
                    _C0028001Magic = true;
                }
                else
                {
                    _C0028001Magic = false;
                }

                // Checking for the DeadBeef CafeBebe Magic on 3 known places
                bufferA = new byte[24];
                bufferB = new byte[24];
                bufferC = new byte[24];

                b.BaseStream.Seek(dbcbOffset1, SeekOrigin.Begin);
                b.Read(bufferA, 0, 24);
                b.BaseStream.Seek(dbcbOffset2, SeekOrigin.Begin);
                b.Read(bufferB, 0, 24);
                b.BaseStream.Seek(dbcbOffset3, SeekOrigin.Begin);
                b.Read(bufferC, 0, 24);

                if (Tool.CompareBytes(bufferA, dbcbMagic) == true)
                {
                    _dbcbMagic1 = true;
                }
                else
                {
                    _dbcbMagic1 = false;
                }
                if (Tool.CompareBytes(bufferB, dbcbMagic) == true)
                {
                    _dbcbMagic2 = true;
                }
                else
                {
                    _dbcbMagic2 = false;
                }
                if (Tool.CompareBytes(bufferC, dbcbMagic) == true)
                {
                    _dbcbMagic3 = true;
                }
                else
                {
                    _dbcbMagic3 = false;
                }

                // Checking if MediaCon FW Stage 1 & Stage 2 do match with 2x byte[32]
                bufferA = new byte[32];
                bufferB = new byte[32];
                bufferC = new byte[32];
                bufferD = new byte[32];

                b.BaseStream.Seek(c01x1A, SeekOrigin.Begin);
                b.Read(bufferA, 0, 32);
                b.BaseStream.Seek(c01x2A, SeekOrigin.Begin);
                b.Read(bufferB, 0, 32);
                b.BaseStream.Seek(c01x1B, SeekOrigin.Begin);
                b.Read(bufferC, 0, 32);
                b.BaseStream.Seek(c01x2B, SeekOrigin.Begin);
                b.Read(bufferD, 0, 32);

                if (Tool.CompareBytes(bufferA, bufferC) == true)
                {
                    _c01A = true;
                }
                else
                {
                    _c01A = false;
                }
                if (Tool.CompareBytes(bufferB, bufferD) == true)
                {
                    _c01B = true;
                }
                else
                {
                    _c01B = false;
                }

                #region CheckUnknownFlashRegion
                // Checking (till now) Unk File Section for first 4 static hex blob Offsets with each of 512 bytes
                // additional we check the first 16 byte Before and After the hex blob if they are FF bytes otherwise we won't check the known blob
                // After that we do the same with the other 4 static hex blob Offsets
                bufferA = new byte[16];
                bufferB = new byte[512];
                bufferC = new byte[16];
                bufferD = new byte[512];

                b.BaseStream.Seek(0x1FFFF0, SeekOrigin.Begin);
                b.Read(bufferA, 0, 16);
                b.BaseStream.Seek(blobOffset1, SeekOrigin.Begin);
                b.Read(bufferB, 0, 512);
                b.BaseStream.Seek(0x200200, SeekOrigin.Begin);
                b.Read(bufferC, 0, 16);

                if (Tool.CompareBytes(bufferA, ffMagic) == true && Tool.CompareBytes(bufferC, ffMagic) == true)
                {
                    if (Tool.CompareBytes(bufferB, bufferD) == false)
                    {
                        _blobMagic1 = true;
                    }
                    else
                    {
                        _blobMagic1 = false;
                    }
                }

                Array.Clear(bufferA, 0, 16);
                Array.Clear(bufferB, 0, 512);
                Array.Clear(bufferC, 0, 16);

                b.BaseStream.Seek(0x200FF0, SeekOrigin.Begin);
                b.Read(bufferA, 0, 16);
                b.BaseStream.Seek(blobOffset2, SeekOrigin.Begin);
                b.Read(bufferB, 0, 512);
                b.BaseStream.Seek(0x201200, SeekOrigin.Begin);
                b.Read(bufferC, 0, 16);

                if (Tool.CompareBytes(bufferA, ffMagic) == true && Tool.CompareBytes(bufferC, ffMagic) == true)
                {
                    if (Tool.CompareBytes(bufferB, bufferD) == false)
                    {
                        _blobMagic2 = true;
                    }
                    else
                    {
                        _blobMagic2 = false;
                    }
                }

                Array.Clear(bufferA, 0, 16);
                Array.Clear(bufferB, 0, 512);
                Array.Clear(bufferC, 0, 16);

                b.BaseStream.Seek(0x201FF0, SeekOrigin.Begin);
                b.Read(bufferA, 0, 16);
                b.BaseStream.Seek(blobOffset3, SeekOrigin.Begin);
                b.Read(bufferB, 0, 512);
                b.BaseStream.Seek(0x202200, SeekOrigin.Begin);
                b.Read(bufferC, 0, 16);

                if (Tool.CompareBytes(bufferA, ffMagic) == true && Tool.CompareBytes(bufferC, ffMagic) == true)
                {
                    if (Tool.CompareBytes(bufferB, bufferD) == false)
                    {
                        _blobMagic3 = true;
                    }
                    else
                    {
                        _blobMagic3 = false;
                    }
                }

                Array.Clear(bufferA, 0, 16);
                Array.Clear(bufferB, 0, 512);
                Array.Clear(bufferC, 0, 16);

                b.BaseStream.Seek(0x202FF0, SeekOrigin.Begin);
                b.Read(bufferA, 0, 16);
                b.BaseStream.Seek(blobOffset4, SeekOrigin.Begin);
                b.Read(bufferB, 0, 512);
                b.BaseStream.Seek(0x203200, SeekOrigin.Begin);
                b.Read(bufferC, 0, 16);

                if (Tool.CompareBytes(bufferA, ffMagic) == true && Tool.CompareBytes(bufferC, ffMagic) == true)
                {
                    if (Tool.CompareBytes(bufferB, bufferD) == false)
                    {
                        _blobMagic4 = true;
                    }
                    else
                    {
                        _blobMagic4 = false;
                    }
                }

                Array.Clear(bufferA, 0, 16);
                bufferB = new byte[304];
                Array.Clear(bufferC, 0, 16);
                bufferD = new byte[304];

                b.BaseStream.Seek(0x2907F0, SeekOrigin.Begin);
                b.Read(bufferA, 0, 16);
                b.BaseStream.Seek(blobOffset5, SeekOrigin.Begin);
                b.Read(bufferB, 0, 304);
                b.BaseStream.Seek(0x290930, SeekOrigin.Begin);
                b.Read(bufferC, 0, 16);

                if (Tool.CompareBytes(bufferA, ffMagic) == true && Tool.CompareBytes(bufferC, ffMagic) == true)
                {
                    if (Tool.CompareBytes(bufferB, bufferD) == false)
                    {
                        _blobMagic5 = true;
                    }
                    else
                    {
                        _blobMagic5 = false;
                    }
                }

                Array.Clear(bufferA, 0, 16);
                bufferB = new byte[224];
                Array.Clear(bufferC, 0, 16);
                bufferD = new byte[224];

                b.BaseStream.Seek(0x2909F0, SeekOrigin.Begin);
                b.Read(bufferA, 0, 16);
                b.BaseStream.Seek(blobOffset6, SeekOrigin.Begin);
                b.Read(bufferB, 0, 224);
                b.BaseStream.Seek(0x290AE0, SeekOrigin.Begin);
                b.Read(bufferC, 0, 16);

                if (Tool.CompareBytes(bufferA, ffMagic) == true && Tool.CompareBytes(bufferC, ffMagic) == true)
                {
                    if (Tool.CompareBytes(bufferB, bufferD) == false)
                    {
                        _blobMagic6 = true;
                    }
                    else
                    {
                        _blobMagic6 = false;
                    }
                }

                Array.Clear(bufferA, 0, 16);
                bufferB = new byte[352];
                Array.Clear(bufferC, 0, 16);
                bufferD = new byte[352];

                b.BaseStream.Seek(0x290BF0, SeekOrigin.Begin);
                b.Read(bufferA, 0, 16);
                b.BaseStream.Seek(blobOffset7, SeekOrigin.Begin);
                b.Read(bufferB, 0, 352);
                b.BaseStream.Seek(0x290D60, SeekOrigin.Begin);
                b.Read(bufferC, 0, 16);

                if (Tool.CompareBytes(bufferA, ffMagic) == true && Tool.CompareBytes(bufferC, ffMagic) == true)
                {
                    if (Tool.CompareBytes(bufferB, bufferD) == false)
                    {
                        _blobMagic7 = true;
                    }
                    else
                    {
                        _blobMagic7 = false;
                    }
                }

                Array.Clear(bufferA, 0, 16);
                bufferB = new byte[64];
                Array.Clear(bufferC, 0, 16);
                bufferD = new byte[64];

                b.BaseStream.Seek(0x290DF0, SeekOrigin.Begin);
                b.Read(bufferA, 0, 16);
                b.BaseStream.Seek(blobOffset8, SeekOrigin.Begin);
                b.Read(bufferB, 0, 64);
                b.BaseStream.Seek(0x290E40, SeekOrigin.Begin);
                b.Read(bufferC, 0, 16);

                if (Tool.CompareBytes(bufferA, ffMagic) == true && Tool.CompareBytes(bufferC, ffMagic) == true)
                {
                    if (Tool.CompareBytes(bufferB, bufferD) == false)
