                    else
                    {
                        _blobMagic8 = false;
                    }
                }
                #endregion CheckUnknownFlashRegion

                // Checking for SCEVTRM Magic on 2 known places
                bufferA = new byte[7];
                bufferB = new byte[7];

                b.BaseStream.Seek(scevtrmOffset1, SeekOrigin.Begin);
                b.Read(bufferA, 0, 7);
                b.BaseStream.Seek(scevtrmOffset2, SeekOrigin.Begin);
                b.Read(bufferB, 0, 7);

                if (Tool.CompareBytes(bufferA, scevtrmMagic) == true)
                {
                    _scevtrmMagic1 = true;
                }
                else
                {
                    _scevtrmMagic1 = false;
                }
                if (Tool.CompareBytes(bufferB, scevtrmMagic) == true)
                {
                    _scevtrmMagic2 = true;
                }
                else
                {
                    _scevtrmMagic2 = false;
                }

                Array.Clear(bufferA, 0, 7);
                Array.Clear(bufferB, 0, 7);

                //Checking FF filled in vtrm 0
                bufferA = new byte[60];
                bufferB = new byte[60];

                b.BaseStream.Seek(scevtrm1FFOffset, SeekOrigin.Begin);
                b.Read(bufferA, 0, 60);
                b.BaseStream.Seek(scevtrm2FFOffset, SeekOrigin.Begin);
                b.Read(bufferB, 0, 60);

                if (Tool.CompareBytes(bufferA, scevtrm1staticFF) == true)
                {
                    _scevtrmFF1 = true;
                }
                else
                {
                    _scevtrmFF1 = false;
                }
                if (Tool.CompareBytes(bufferB, scevtrm2staticFF) == true)
                {
                    _scevtrmFF2 = true;
                }
                else
                {
                    _scevtrmFF2 = false;
                }

                Array.Clear(bufferA, 0, 60);
                Array.Clear(bufferA, 0, 60);

                //checking static in vtrm 0
                bufferA = new byte[4];
                bufferB = new byte[6];
                bufferC = new byte[7];
                bufferD = new byte[5];
                bufferE = new byte[7];
                bufferF = new byte[8];
                bufferG = new byte[255];

                b.BaseStream.Seek(scevtrm0Static0FFOffset1, SeekOrigin.Begin);
                b.Read(bufferA, 0, 4);
                b.BaseStream.Seek(scevtrm0Static0FFOffset2, SeekOrigin.Begin);
                b.Read(bufferB, 0, 6);
