        {
            using (BinaryReader b = new BinaryReader(new FileStream(dump, FileMode.Open)))
            {
                b.BaseStream.Seek(skuOffset, SeekOrigin.Begin);
                b.Read(sku, 0, 14);
                return sku;
            }
        }

        // Get SKU Version
        public static byte[] GetSKUVersion(string dump)
        {
            using (BinaryReader b = new BinaryReader(new FileStream(dump, FileMode.Open)))
            {
                b.BaseStream.Seek(skuVerOffset, SeekOrigin.Begin);
                b.Read(skuVer, 0, 4);
                return skuVer;
            }
        }

        // Get FirmWare Version
        public static byte[] GetFWV(string dump)
        {
            using (BinaryReader b = new BinaryReader(new FileStream(dump, FileMode.Open)))
            {
                bufferA = new byte[4];
                b.BaseStream.Seek(fwvOffset, SeekOrigin.Begin);
                b.Read(fwv, 0, 4);
                Array.Reverse(fwv);
                return fwv;
            }
        }

        // Get Mobo Version
        public static byte[] GetMobo(string dump)
