            using (BinaryReader b = new BinaryReader(new FileStream(dump, FileMode.Open)))
            {
                bufferA = new byte[14];
                b.BaseStream.Seek(Moboffset, SeekOrigin.Begin);
                b.Read(mobo, 0, 14);
                return mobo;
            }
        }

        // Get Torus version
        public static byte[] GetTorus(string dump)
        {
            using (BinaryReader b = new BinaryReader(new FileStream(dump, FileMode.Open)))
            {
                bufferA = new byte[10];
                b.BaseStream.Seek(TorusOffset, SeekOrigin.Begin);
                b.Read(Torus, 0, 10);
                return Torus;
            }
        }

        // Get Torus size
        public static byte[] GetTorusSize(string dump)
        {
            using (BinaryReader b = new BinaryReader(new FileStream(dump, FileMode.Open)))
            {
                b.BaseStream.Seek(0x144024, SeekOrigin.Begin);
                b.Read(TorusSize, 0, 3);
                Array.Reverse(TorusSize);
                return TorusSize;
            }
        }

        public static byte[] GetOccurance(string dump)
        {
            using (BinaryReader b = new BinaryReader(new FileStream(dump, FileMode.Open)))
            {
                b.BaseStream.Seek(0x000000, SeekOrigin.Begin);
                b.Read(bufferDumpSize, 0, 33554432);
                return bufferDumpSize;
            }
        }

